import React from "react";
function OferaProdus() {
  return (
    <>
      <h1>Ofera un produs</h1>
      &
      <form className="frigider">
        <div>
          <label htmlFor="frigider">Frigider</label>
          <select name="grup">
            <option value="vegetarian">Vegetarian</option>
            <option value="pofticios de de toate">Iubitor de zacusca</option>
            <option value="vegan">Vegan</option>
            <option value="iubitor de dulciuri">Iubitor de dulciuri</option>
            <option value="carnivor">Carnivor</option>
          </select>
        </div>
      </form>
    </>
  );
}
export default OferaProdus;
